import React, { useEffect, useState } from 'react';
import './TestResult.css';
import ABTestService from '../../services/api';
import { TestResultResponse } from '../../services/types';

interface TestResultProps {
  test_name: string | null;
}
const TestResult: React.FC<TestResultProps> = ({ test_name }) => {
  const [testResults, setTestResults] = useState<TestResultResponse | null>(null);

  useEffect(() => {
    const fetchTestResult = async () => {
      try {
        if (test_name) {
          const data = await ABTestService.fetchData(test_name);
          setTestResults(data);
        }
      } catch (error) {
        console.error('Error fetching test results:', error);
      }
    };

    fetchTestResult();
  }, [test_name]);

  if (!testResults) {
    return <div>Loading...</div>;
  }

  let winner = null;
  if(testResults.control_clickthrough_rate > testResults.variant_clickthrough_rate) {
    winner = 'Control';
  } else if(testResults.control_clickthrough_rate < testResults.variant_clickthrough_rate) {
    winner = 'Variant';
  }

  return (
    <div className="test-results">
      <p className="blue-text">{testResults.message}</p>

      <table className="results-table">
        <thead>
          <tr>
            <th></th>
            <th>Control Group</th>
            <th>Variant Group</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Click Through Rate</td>
            <td className="blue-text">{testResults.control_clickthrough_rate}</td>
            <td className="blue-text">{testResults.variant_clickthrough_rate}</td>
          </tr>
          <tr>
            <td>Total Clicks</td>
            <td className="blue-text">{testResults.control_total_clicks}</td>
            <td className="blue-text">{testResults.variant_total_clicks}</td>
          </tr>
          <tr>
            <td>Total Impressions</td>
            <td className="blue-text">{testResults.control_total_impressions}</td>
            <td className="blue-text">{testResults.variant_total_impressions}</td>
          </tr>
        </tbody>
      </table>

      <p className="blue-text">p-value: {testResults.p_value}</p>
      <p className="blue-text">Confidence Interval: {testResults.confidence_interval}</p>

      <h3>The Winner is: {winner ? winner : 'No winner'} {winner ? 'ðŸŽ‰' : 'ðŸ˜ž'}</h3>
      <p className="blue-text">
        {winner === 'Control'
          ? 'The Control group had a higher click-through rate, therefore, it is the winner.'
          : winner === 'Variant'
          ? 'The Variant group had a higher click-through rate, therefore, it is the winner.'
          : 'Neither group had a higher click-through rate.'}
      </p>

      <p className="blue-text">Status: {testResults.status}</p>
    </div>
  );
};

export default TestResult;
